import React, { Fragment } from 'react';
import PropTypes from 'prop-types';
import { isNotEmptyArray } from '../utils/global-functions';

export const BannerCard = ({ imageUrl, id, images }) => {
  return (
    <Fragment>
      {
        isNotEmptyArray(images) &&
        <div id={id} className='swiper-slide'>
          {
            images.map((image,imageIndex))
          }
          <img src={imageUrl || 'image/home/banner.jpg'} className='img-fluid' />
        </div>
      }

    </Fragment>
  );
};

BannerCard.propTypes = {
  images: PropTypes.array
};
